    "contracts/mocks/MockSymmio.sol": {
      "content": "// SPDX-License-Identifier: BUSL-1.1
pragma solidity ^0.8.21;
import "../TradingCompetition/Perpetual/interfaces/IViewFacet.sol";
import "forge-std/console.sol";

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

struct SingleUpnlSig {
    bytes reqId;
    uint256 timestamp;
    int256 upnl;
    bytes gatewaySignature;
    SchnorrSign sigs;
}

struct SchnorrSign {
    uint256 signature;
    address owner;
    address nonce;
}

contract MockSymmio {
    event Deposit(address sender, address user, uint256 amount);
    event Withdraw(address sender, address user, uint256 amount);
    event AllocatePartyA(address user, uint256 amount);
    event DeallocatePartyA(address user, uint256 amount);

    event AllocateForPartyB(address partyB, address partyA, uint256 amount);
    event DeallocateForPartyB(address partyB, address partyA, uint256 amount);
    event TransferAllocation(uint256 amount, address origin, address recipient);

    using SafeERC20 for IERC20;
    address public collateralToken;

    mapping(uint => Quote) internal mappingQuoteIdToQuote; //internal or compiler error, use the getter
    mapping(address => uint) internal mappingPartyAToQuotesLength; //internal or compiler error, use the getter
    mapping(address => uint) internal balances; //More simplistic than symmio, but should work for testing
    mapping(address => uint[]) public mappingPartyAToQuoteIds;

    mapping(uint => string) public pairIdToName;

    uint public nextQuoteId;

    // constructor(address _collateralToken) {
    //     collateralToken = _collateralToken;
    //     nextQuoteId = 10000;
    // }
    
    function initialize(address _collateralToken) external {
        collateralToken = _collateralToken;
        nextQuoteId = 10000;
    }
    

    function getCollateral() external view returns (address) {
        return collateralToken;
    }

    function balanceOf(address user) external view returns (uint256) {
        return balances[user];
    }

    function quotesLength(address user) external view returns (uint256) {
        return mappingPartyAToQuotesLength[user];
    }

    function quoteIdsOf(
        address partyA,
        uint256 start,
        uint256 size
    ) external view returns (uint256[] memory) { 
        uint256[] memory quoteIds = new uint256[](size);
        for (uint256 i = 0; i < size; i++) {
            quoteIds[i] = mappingPartyAToQuoteIds[partyA][start + i];
        }
        return quoteIds;
    }

    function getQuote(uint256 _quoteId) external view returns (Quote memory) {
        return mappingQuoteIdToQuote[_quoteId];
    }

    function allocate(uint256 amount) external {
        console.log("Symmio::allocate()");
        emit AllocatePartyA(msg.sender, amount);
    }

    function allocateMock(uint256 amount, address sender) external {
        console.log("Symmio::allocateMock()");
        emit AllocatePartyA(sender, amount);
    }

    function withdrawTo(address user, uint256 amount) external {
        console.log("Symmio::withdrawTo()");
        emit Withdraw(msg.sender, user, amount);
    }

    function withdrawToMock(address user, uint256 amount, address sender) external {
        console.log("Symmio::withdrawToMock()");
        emit Withdraw(sender, user, amount);
    }

    function withdraw(uint256 amount) external {
        console.log("Symmio::withdraw()");
        emit Withdraw(msg.sender, msg.sender, amount);
    }

    function withdrawMock(uint256 amount, address sender) external {
        console.log("Symmio::withdraw()");
        emit Withdraw(sender, sender, amount);
    }

    function deposit(uint256 amount) external {
        console.log("Symmio::deposit()");
        IERC20(collateralToken).safeTransferFrom(msg.sender, address(this), amount);
        balances[msg.sender] += amount;
        emit Deposit(msg.sender, msg.sender, amount);
    }

    function depositMock(uint256 amount, address sender) external {
        console.log("Symmio::deposit()");
        IERC20(collateralToken).safeTransferFrom(sender, address(this), amount);
        balances[sender] += amount;
        emit Deposit(sender, sender, amount);
    }

    function depositAndAllocate(uint256 amount) external {
        console.log("Symmio::depositAndAllocate()");
        IERC20(collateralToken).safeTransferFrom(msg.sender, address(this), amount);
        balances[msg.sender] += amount;
        emit Deposit(msg.sender, msg.sender, amount);
        emit AllocatePartyA(msg.sender, amount);
    }

    function depositAndAllocateMock(uint256 amount, address sender) external {
        console.log("Symmio::depositAndAllocate()");
        IERC20(collateralToken).safeTransferFrom(sender, address(this), amount);
        balances[sender] += amount;
        emit Deposit(sender, sender, amount);
        emit AllocatePartyA(sender, amount);
    }

    function depositFor(address user, uint256 amount) external {
        console.log("Symmio::depositFor()");
        IERC20(collateralToken).safeTransferFrom(msg.sender, address(this), amount);
        balances[user] += amount;
        emit Deposit(msg.sender, user, amount);
    }

    function depositForMock(address user, uint256 amount, address sender) external {
        console.log("Symmio::depositFor()");
        IERC20(collateralToken).safeTransferFrom(sender, address(this), amount);
        balances[user] += amount;
        emit Deposit(sender, user, amount);
    }

    function deallocate(uint256 amount, SingleUpnlSig memory upnlSig) external {
        emit DeallocatePartyA(msg.sender, amount);
    }

    function deallocateMock(uint256 amount, SingleUpnlSig memory upnlSig, address sender) external {
        emit DeallocatePartyA(sender, amount);
    }

    function mockAddQuote(address partyA, uint symbolId) external {
        Quote memory newQuote = Quote({
            id: nextQuoteId,
            partyBsWhiteList: new address[](0),
            symbolId: symbolId,
            positionType: PositionType.LONG,
            orderType: OrderType.LIMIT,
            openedPrice: 0,
            initialOpenedPrice: 0,
            requestedOpenPrice: 0,
            marketPrice: 0,
            quantity: 0,
            closedAmount: 0,
            initialLockedValues: LockedValues(0,0,0),
            lockedValues: LockedValues(0,0,0),
            maxFundingRate: 0,
            partyA: partyA,
            partyB: address(0),
            quoteStatus: QuoteStatus.OPENED,
            avgClosedPrice: 0,
            requestedClosePrice: 0,
            quantityToClose: 0,
            parentId: 0,
            createTimestamp: block.timestamp,
            statusModifyTimestamp: 0,
            lastFundingPaymentTimestamp:0,
            deadline: 0,
            tradingFee: 0
        });

        mappingQuoteIdToQuote[nextQuoteId] = newQuote;
        mappingPartyAToQuoteIds[partyA].push(nextQuoteId);
        mappingPartyAToQuotesLength[partyA] = mappingPartyAToQuotesLength[partyA] + 1;

        nextQuoteId++;
    }

    function mockSetQuoteSymbolId(uint _quoteId, uint _newSymbolId) external {
        mappingQuoteIdToQuote[_quoteId].symbolId = _newSymbolId;
    }

    function mockSetQuoteCreateTimestamp(uint _quoteId, uint _timestamp) external {
        mappingQuoteIdToQuote[_quoteId].createTimestamp = _timestamp;
    }

    function setPairName(uint id, string calldata name) external {
        pairIdToName[id] = name;
    }
    
    function setUserBalance(address partyA, uint balance) external {
        balances[partyA] = balance;
    }

}
"
    },
    "contracts/TradingCompetition/Perpetual/interfaces/IViewFacet.sol": {
      "content": "// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;

enum PositionType {
    LONG,
    SHORT
}

enum OrderType {
    LIMIT,
    MARKET
}

enum QuoteStatus {
    PENDING, //0
    LOCKED, //1
    CANCEL_PENDING, //2
    CANCELED, //3
    OPENED, //4
    CLOSE_PENDING, //5
    CANCEL_CLOSE_PENDING, //6
    CLOSED, //7
    LIQUIDATED, //8
    EXPIRED //9
}

struct LockedValues {
    uint256 cva;
    uint256 mm;
    uint256 lf;
}

struct Quote {
    uint256 id;
    address[] partyBsWhiteList;
    uint256 symbolId;
    PositionType positionType;
    OrderType orderType;
    // Price of quote which PartyB opened in 18 decimals
    uint256 openedPrice;
    uint256 initialOpenedPrice;
    // Price of quote which PartyA requested in 18 decimals
    uint256 requestedOpenPrice;
    uint256 marketPrice;
    // Quantity of quote which PartyA requested in 18 decimals
    uint256 quantity;
    // Quantity of quote which PartyB has closed until now in 18 decimals
    uint256 closedAmount;
    LockedValues initialLockedValues;
    LockedValues lockedValues;
    uint256 maxFundingRate;
    address partyA;
    address partyB;
    QuoteStatus quoteStatus;
    uint256 avgClosedPrice;
    uint256 requestedClosePrice;
    uint256 quantityToClose;
    // handle partially open position
    uint256 parentId;
    uint256 createTimestamp;
    uint256 statusModifyTimestamp;
    uint256 lastFundingPaymentTimestamp;
    uint256 deadline;
    uint256 tradingFee;
}

struct Symbol {
    uint256 symbolId;
    string name;
    bool isValid;
    uint256 minAcceptableQuoteValue;
    uint256 minAcceptablePortionLF;
    uint256 tradingFee;
    uint256 maxLeverage;
    uint256 fundingRateEpochDuration;
    uint256 fundingRateWindowTime;
}

interface ISymmioViewFacet {
    function balanceOf(address user) external view returns (uint256);

    function partyAStats(
        address partyA
    )
        external
        view
        returns (
            bool,
            uint256,
            uint256,
            uint256,
            uint256,
            uint256,
            uint256,
            uint256,
            uint256,
            uint256,
            uint256,
            uint256,
            uint256,
            uint256
        );

    function balanceInfoOfPartyA(
        address partyA
    )
        external
        view
        returns (uint256, uint256, uint256, uint256, uint256, uint256, uint256, uint256, uint256);

    function allocatedBalanceOfPartyA(address partyA) external view returns (uint256);

    function withdrawCooldownOf(address user) external view returns (uint256);

    function nonceOfPartyA(address partyA) external view returns (uint256);

    function isSuspended(address user) external view returns (bool);    

    function getSymbol(uint256 symbolId) external view returns (Symbol memory);

    function getSymbols(uint256 start, uint256 size) external view returns (Symbol[] memory);

    function symbolsByQuoteId(uint256[] memory quoteIds) external view returns (Symbol[] memory);

    function symbolNameByQuoteId(uint256[] memory quoteIds) external view returns (string[] memory);

    function symbolNameById(uint256[] memory symbolIds) external view returns (string[] memory);

    function getQuote(uint256 quoteId) external view returns (Quote memory);

    function getQuotesByParent(uint256 quoteId, uint256 size) external view returns (Quote[] memory);

    function quoteIdsOf(address partyA, uint256 start, uint256 size) external view returns (uint256[] memory);

    function getQuotes(address partyA, uint256 start, uint256 size) external view returns (Quote[] memory);

    function quotesLength(address user) external view returns (uint256);

    function partyAPositionsCount(address partyA) external view returns (uint256);

    function getPartyAOpenPositions(address partyA, uint256 start, uint256 size) external view returns (Quote[] memory);

    function getPartyAPendingQuotes(address partyA) external view returns (uint256[] memory);

    function getCollateral() external view returns (address);

}"
    },
